import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card';

function CardStyle({person}) {
  return (
    <Card style={{ width: '18rem' }}>
      <Card.Img variant="top" src={person.image}></Card.Img> 
      <Card.Body>
        <Card.Title>{person.id}</Card.Title>
        <Card.Text>
        Talle ={person.size}<br></br> 
        Color ={person.color}<br></br>
        Precio={person.price}
        </Card.Text>
        <Button variant="primary">Click</Button>
      </Card.Body>
    </Card>
  );
}

export default CardStyle;
